import React from "react";

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>Home</li>
        <li className="dropdown">
          <a href="#">Features</a>
          <div className="dropdown-content">
            <a href="#">Interactive Learning Modules</a>
            <a href="#">Progress Tracking</a>
            <a href="#">Customizable Study Plans</a>
            <a href="#">Resource Recommendations</a>
            <a href="#">Integration with Official Materials</a>
          </div>
        </li>
        <li>About</li>
        {/* Add more navbar items as needed */}
      </ul>
    </nav>
  );
};

export default Navbar;
